import {
  TOGGLE,
  DELETE_PLAYERS,
  ADD_PLAYER
} from './types';

export const toggle = () => {
  return {
    type: TOGGLE
  };
};

export const deletePlayers = () => {
  return {
    type: DELETE_PLAYERS
  };
};

export const addPlayer = () => {
  return {
    type: ADD_PLAYER
  };
};
